script: |
  super -f text -I q1990.spq | sort > q1990.out

inputs:
  - name: q1990.spq
    data: |
      SELECT col2 AS col0, 35 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT + + col1 - + + col2 NOT BETWEEN + + 86 + + col1 - - - col0 AND + 14;
  - name: tab0

outputs:
  - name: q1990.out
    data: |
